Description: What are PopSockets? PopSockets are expanding grips and stands that attach to most phones, tablets, and cases. Add a single PopSocket, or a pair of PopSockets, to the back of almost any mobile device to transform its capabilities. PopSockets "pop" whenever you need a grip, a Stand, an earbud-management system, or just something to play with. Remove your PopSocket by Pulling slowly on the base; you can reposition and Reattach time and time again. You'll always have the exact grip or Stand you need.
Features: Peace Love Sunshine features a peace sign, a heart & a sunflower. Cute sunflower for women, men, kids, girls, wife, sister, daughter, mom, sunflower lovers or anyone who love sunshine Do you or someone you know love Sunshine and sunflower? Then get this sunflower lover gifts for birthday, summer, christmas or holiday present or everyday. PopGrip with swappable top; switch out your PopTop for another design or remove it completely for wireless charging capabilities. (Not compatible with Apple MagSafe wireless charger or MagSafe wallet.) Expandable stand to watch videos, take group photos, FaceTime, and Skype handsfree. Advanced adhesive allows you to remove and reposition on most devices and cases. Note: Will not stick to some silicone, waterproof, or highly textured cases. Works best with smooth, hard plastic cases. Will adhere to iPhone 11, but not to the iPhone 11 Pro nor the iPhone 11 ProMax without a suitable case.
